import React from 'react';
import { Formik, Form, Field, ErrorMessage, useField } from 'formik';
import BotonFormulario from '../../botones/BotonFormulario'

const FormularioAsignaturas = (props) => {

    var asignaturas = [];

    const agregarAsignatura = (nueva_asignatura) => {
        asignaturas = [
            ...asignaturas,
            nueva_asignatura
        ]
        console.log(asignaturas)
    }

    return(
        <div>
        <label>
            {props.value}
                <Formik
                    initialValues={{asignaturas: ''}}
                    onSubmit={values => {agregarAsignatura(values)}} 
                >
                    <Form>
                        <Field name="asignaturas" type="text"/>
                        <BotonFormulario value="Agregar"/>
                    </Form>
                </Formik>
        </label>
        </div>
    );
}

export default FormularioAsignaturas;
